import {Button, Form, FormControl, Nav, Navbar} from "react-bootstrap";

export const NavBarC = () => {
    return (
        <Navbar bg="light" variant="light">

            <Nav className="mr-auto">
                <Nav.Link href="#home">Вид</Nav.Link>
                <Nav.Link href="#features">Правка</Nav.Link>
                <Nav.Link href="#pricing">Настройки</Nav.Link>
            </Nav>
            <Form inline>
                <FormControl type="text" placeholder="Поиск" className="mr-sm-2" />
                <Button variant="outline-primary">Поиск</Button>
            </Form>
        </Navbar>
    )
}
